import React from 'react';
import ReactDOM from 'react-dom';
import './Contributors.css';

function addNewlines(str) {
    var result = '';
    while (str.length > 0) {
      result += str.substring(0, 200) + '\n';
      str = str.substring(200);
    }
    return result;
  }

  <p id="demo"></p>
  function printContributors(object){
    for (var i = 0; i<1; i+=3) {
        document.getElementById("demo").innerHTML += object[0] +"\n";
    }
  }


function Contributors() {

    let map = new Map();
    map.set("Contributor 1", "I am a cat");
    map.set("Contributor 2", "I am a dog");
    map.set("Contributor 3", "I am a cow");

    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Contributors
                </p>
            </header>
            
            {printContributors(map)};
            
        </div>
    );
}



export default Contributors;

